class Solution:
    def maxDistance(self, grid) -> int:
        rows, cols = len(grid), len(grid[0])
        queue = []
        visited = [[False] * cols for _ in range(rows)]

        for r in range(rows):
            for c in range(cols):
                if grid[r][c] == 1:
                    queue.append((-1, (r, c)))
                    visited[r][c] = True

        max_distance = -1
        while queue:
            d, coordinates = queue.pop(0)
            r, c = coordinates
            max_distance = max(max_distance, d)
            for nr, nc in [(r - 1, c), (r, c - 1), (r + 1, c), (r, c + 1)]:
                if 0 <= nr < rows and 0 <= nc < cols and grid[nr][nc] == 0 and not visited[nr][nc]:
                    visited[nr][nc] = True
                    queue.append((d + 1, (nr, nc)))

        return max_distance if max_distance == -1 else max_distance + 1




